--
-- Name: augment_create; Type: VIEW; Schema: xenox; Owner: poppi
--

CREATE VIEW xenox.augment_create AS
 WITH augments AS (
         SELECT aug_names.name,
            augments."materialST",
            augments."mctST"
           FROM (xbx.btl_itemskill_inner augments
             JOIN xbx.battleskill_ms aug_names ON ((aug_names.row_id = augments."Name")))
        UNION ALL
         SELECT aug_names.name,
            augments."materialST",
            augments."mctST"
           FROM (xbx.btl_itemskill_doll augments
             JOIN xbx.battleskill_dl_ms aug_names ON ((aug_names.row_id = augments."Name")))
        ), create_mats AS (
         SELECT augments.name,
            a.item,
            a.amount,
            a.nr
           FROM (augments
             JOIN LATERAL UNNEST(augments."materialST", augments."mctST") WITH ORDINALITY a(item, amount, nr) ON (true))
        )
 SELECT create_mats.name,
    COALESCE(item_names.name, rare_item_names.name) AS material,
    create_mats.amount
   FROM ((((create_mats
     LEFT JOIN xbx.itm_materiallist items ON (((create_mats.item = items.row_id) AND (create_mats.nr = ANY (ARRAY[(1)::bigint, (2)::bigint, (3)::bigint])))))
     LEFT JOIN xbx.itm_materiallist_ms item_names ON ((items."Name" = item_names.row_id)))
     LEFT JOIN xbx.itm_rarersclist rare_items ON (((create_mats.item = rare_items.row_id) AND (create_mats.nr = 4))))
     LEFT JOIN xbx.itm_rarersclist_ms rare_item_names ON ((rare_items."Name" = rare_item_names.row_id)))
  WHERE (create_mats.item <> 0);


ALTER TABLE xenox.augment_create OWNER TO poppi;

--
-- Name: augment_upgrade; Type: VIEW; Schema: xenox; Owner: poppi
--

CREATE VIEW xenox.augment_upgrade AS
 WITH augments AS (
         SELECT aug_names.name,
            augments."materialMA",
            augments."mctMA"
           FROM (xbx.btl_itemskill_inner augments
             JOIN xbx.battleskill_ms aug_names ON ((aug_names.row_id = augments."Name")))
        UNION ALL
         SELECT aug_names.name,
            augments."materialMA",
            augments."mctMA"
           FROM (xbx.btl_itemskill_doll augments
             JOIN xbx.battleskill_dl_ms aug_names ON ((aug_names.row_id = augments."Name")))
        ), upgrade_mats AS (
         SELECT augments.name,
            unnest(augments."materialMA") AS item,
            unnest(augments."mctMA") AS amount
           FROM augments
        )
 SELECT upgrade_mats.name,
    item_names.name AS material,
    upgrade_mats.amount
   FROM ((upgrade_mats
     JOIN xbx.itm_materiallist items ON ((upgrade_mats.item = items.row_id)))
     LEFT JOIN xbx.itm_materiallist_ms item_names ON ((items."Name" = item_names.row_id)));


ALTER TABLE xenox.augment_upgrade OWNER TO poppi;

--
-- Name: augments; Type: VIEW; Schema: xenox; Owner: poppi
--

CREATE VIEW xenox.augments AS
 WITH augments AS (
         SELECT btl_itemskill_inner.row_id AS id,
            aug_names.name,
            btl_itemskill_inner."enhanceID",
            btl_itemskill_inner."Rare",
            btl_itemskill_inner."Price",
            btl_itemskill_inner.miraniumu
           FROM (xbx.btl_itemskill_inner
             JOIN xbx.battleskill_ms aug_names ON ((btl_itemskill_inner."Name" = aug_names.row_id)))
        UNION ALL
         SELECT (btl_itemskill_doll.row_id + 3667) AS id,
            aug_names.name,
            btl_itemskill_doll."enhanceID",
            btl_itemskill_doll."Rare",
            btl_itemskill_doll."Price",
            btl_itemskill_doll.miraniumu
           FROM (xbx.btl_itemskill_doll
             JOIN xbx.battleskill_dl_ms aug_names ON ((btl_itemskill_doll."Name" = aug_names.row_id)))
        )
 SELECT augments.id,
    augments.name,
    xenox.format_caption(captions.name, enhance.ratio, enhance.param1, enhance.param2) AS effect,
    augments."Price" AS sell_price,
        CASE
            WHEN (augments."Rare" = 1) THEN 'Common'::text
            WHEN (augments."Rare" = 2) THEN 'Rare'::text
            WHEN (augments."Rare" = 3) THEN 'Unique'::text
            WHEN (augments."Rare" = 4) THEN 'Prime'::text
            WHEN (augments."Rare" = 5) THEN 'Intergalactic'::text
            ELSE NULL::text
        END AS rarity,
    augments.miraniumu AS miranium
   FROM ((augments
     JOIN xbx.btl_enhance enhance ON ((augments."enhanceID" = enhance.row_id)))
     JOIN xbx.btl_enhance_ms captions ON ((enhance.caption = captions.row_id)));


ALTER TABLE xenox.augments OWNER TO poppi;

